),(926,18,'faq_3_question','Roommate Matching'),(927,18,'_faq_3_question','field_5303db27cc825'),(928,18,'faq_3_answer','For students who are new to the area or dont have roommates chosen, The Woodlands can help match roommates who may like living together.'),(929,18,'_faq_3_answer','field_5303db36cc826'),(930,18,'faq_4_question','Pet Friendly'),(931,18,'_faq_4_question','field_5303db27cc825'),(932,18,'faq_4_answer','Many students like the comfort and security of having a pet during college. The Woodlands is pet friendly and offers pet walk areas and pet stations throughout the property.'),(933,18,'_faq_4_answer','field_5303db36cc826'),(934,18,'faq_5_question','Various Rates & Floorplans'),(935,18,'_faq_5_question','field_5303db27cc825'),(936,18,'faq_5_answer','Depending on living arrangement needs and budget, The Woodlands offers six different floorplans among 2, 3 and 4 bedroom homes with various rates'),(937,18,'_faq_5_answer','field_5303db36cc826'),(938,18,'faq_6_question','Private After Hours Security'),(939,18,'_faq_6_question','field_5303db27cc825'),(940,18,'faq_6_answer','We have on-site security that patrols the property after-hours. In addition, homes have security systems with additional monitoring services available upon request.'),(941,18,'_faq_6_answer','field_5303db36cc826'),(942,18,'faq_7_question','Electronic Key Systems'),(943,18,'_faq_7_question','field_5303db27cc825'),(944,18,'faq_7_answer','Every residence and bedroom at The Woodlands is outfitted with an electronic key system. This system prevents key duplication, provides a record log of uses for security and allows maintenance keys to only work during designated times. The key system also allows residents access to the clubhouse 24 hours a day.'),(945,18,'_faq_7_answer','field_5303db36cc826'),(946,127,'_menu_item_type','post_type'),(947,127,'_menu_item_menu_item_parent','0'),(948,127,'_menu_item_object_id','9'),(949,127,'_menu_item_object','page'),(950,127,'_menu_item_target',''),(951,127,'_m