0 residents, moving trucks, parents, etc.)</li>\r\n	<li>Please come to the clubhouse during your move in slot (There may seem like too many people and tasks, but as long as your file is complete and you have your ID and first months rent ready you will be in and out promptly.)</li>\r\n	<li>Check in at the cyber caf. Here you will receive your move in folders, as well as a checklist that will guide you through the move in process.</li>\r\n	<li>Complete paperwork, if applicable.</li>\r\n	<li>Pay your first months rent &amp; sign up for an account on RentPayment.com</li>\r\n	<li>Pick up your keys!</li>\r\n	<li>Once youve gotten settled into your unit, please be sure to fill out your move in inspection form (This will be in your move in folder.) Please note any damages you find. This must be completed &amp; turned in to the office within 48 hours from the time you picked up your keys to move in. (A move-in inspection form is NOT a maintenance request  it is used only to document the condition of the unit at the time you moved in.)</li>\r\n	<li>Submit maintenance requests, if needed. The move-in inspection form is NOT a maintenance request, and only serves as documentation of the condition of the unit when you moved in. (Any emergency maintenance will be handled first. We will always strive to handle maintenance issues ASAP, but the first few days will be handled in order of severity, so please be patient.)</li>\r\n</ol>\r\n</div>\r\n<div id=\"tabs-3\">\r\n<div>\r\n<h3></h3>\r\n<h3>First Month\'s Rent</h3>\r\nYou can only pay your first month\'s rent by check. Its a good idea to bring an extra blank check just in case (if you mess up a check you have another and it won\'t delay your process)\r\n\r\n</div>\r\n</div>'),(1201,30,'_tabs_1_tab_content','field_5306268e024cc'),(1202,30,'tabs_2_tab_title','Items To Bring'),(1203,30,'_tabs_2_tab_title','field_53062681024cb'),(1204,30,'tabs_2_tab_content','Once again, please contact the office to make sure your file is 100% complete before moving in. One thing to remember: We may still be missing items from the guarantor as well. If you are unsure as to whether your file is complete, please call the office and we will gladly assist you.\r\n<ul>\r\n	<li>Government-Issued photo I.D.</li>\r\n	<li>First months rent (If paying by check, its a good idea to bring an extra blank check just in case.)</li>\r\n</ul>\r\n<strong>Bedroom</strong>\r\n<ul>\r\n	<li>Alarm Clock</li>\r\n	<li>Bedding</li>\r\n	<li>Extension Cords</li>\r\n	<li>Mattress Pad</li>\r\n	<li>TV</li>\r\n	<li>Under Bed Storage</li>\r\n	<li>Calendar</li>\r\n	<li>Desk Lamp</li>\r\n	<li>School Supplies</li>\r\n	<li>Trash Can</li>\r\n</ul>\r\n<strong>Electronics &amp; Accessories</strong>\r\n<ul>\r\n	<li>TV</li>\r\n	<li>DVD Player</li>\r\n	<li>Cables</li>\r\n	<li>Cell Phone Charger</li>\r\n	<li>Headphones</li>\r\n	<li>Laptop</li>\r\n	<li>Printer</li>\r\n	<li>Surge Protector</li>\r\n</ul>\r\n<strong>Bathroom</strong>\r\n<ul>\r\n	<li>Toiletries</li>\r\n	<li>Towels</li>\r\n	<li>Shower Curtain</li>\r\n	<li>Shower Caddy</li>\r\n	<li>Toilet Paper</li>\r\n	<li>Trashcan</li>\r\n	<li>Medical Supplies</li>\r\n</ul>\r\n<strong>Appliances/Supplies</strong>\r\n<ul>\r\n	<li>Blender</li>\r\n	<li>Plates/ Bowls</li>\r\n	<li>Can/Bottle Opener</li>\r\n	<li>Chopping Board</li>\r\n	<li>Coffee Maker</li>\r\n	<li>Utensils</li>\r\n	<li>Cups &amp; Mugs</li>\r\n	<li>Dishwashing Supplies</li>\r\n	<li>Measuring Spoons/Cups</li>\r\n	<li>Pots &amp; Pans</li>\r\n	<li>Toaster</li>\r\n	<li>Trashcan</li>\r\n</ul>\r\n<strong>Miscellaneous</strong>\r\n<ul>\r\n	<li>Paper Towels/ Toilet Paper</li>\r\n	<li>Aluminum Foil/ Zip Lock Bags</li>\r\n	<li>Cleaning Supplies</li>\r\n	<li>Vacuum</li>\r\n	<li>Laundry Supplies</li>\r\n	<li>Batteries</li>\r\n	<li>Tool Kit</li>\r\n</ul>\r\n&nbsp;'),(1205,30,'_tabs_2_tab_content','field_5306268e024cc'),(1206,30,'tabs_3_tab_title','Resources'),(1207,30,'_tabs_3_tab_title','field_53062681024cb'),(1208,30,'tabs_3_tab_content','<h3>Resources</h3>\r\nBelow are some helpful links to local goods and service for move-in.\r\n<ul>\r\n	<li><a href=\"https://www.google.com/maps?q=moving+trucks+near+Gainesville,+FL&amp;hl=en&amp;sll=30.429286,-91.178112&amp;sspn=0.153196,0.197582&amp;oq=moving+trucks+near+gaines&amp;hq=moving+trucks&amp;hnear=Gainesville,+Alachua,+Florida&amp;t=m&amp;z=13\" target=\"_blank\">Moving Truck Listing</a></li>\r\n	<li><a href=\"https://www.google.com/maps?q=storage+near+Gainesville,+FL&amp;hl=en&amp;sll=30.418595,-91.09815&amp;sspn=0.306426,0.395164&amp;oq=storage+near+Gaines&amp;hq=storage&amp;hnear=Gainesville,+Alachua,+Florida&amp;t=m&amp;z=13\" target=\"_blank\">Local Storage</a></li>\r\n	<li><a href=\"https://www.google.com/maps/search/moving+companies+near+Gainesville,+FL/@29.6862705,-82.319746,12z/data=!3m1!4b1?hl=en\" target=\"_blank\">Moving Companies</a></li>\r\n</ul>'),(1209,30,'_tabs_3_tab_content','field_5306268e024cc'),(1210,30,'tabs_4_tab_title','Change Of Address'),(1211,30,'_tabs_4_tab_title','field_53062681024cb'),(1212,30,'tabs_4_tab_content','<h3>Change Of Address</h3>\r\nAfter you move in you will need to go to the<a href=\"https://www.usps.com/umove/\" target=\"_blank\">USPS Move Out LINK</a>and complete the steps to make sure that all of your mail will get forwarded to your new address at the Woodlands.'),(1213,30,'_tabs_4_tab_content','field_5306268e024cc'),(1219,30,'tabs_0_tab_button_url','#'),(1220,30,'_tabs_0_tab_button_url','field_53063bdfa3b2d'),(1221,30,'tabs_1_tab_button_url',''),(1222,30,'_tabs_1_tab_button_url','field_53063bdfa3b2d'),(1223,30,'tabs_2_tab_button_url',''),(1224,30,'_tabs_2_tab_button_url','field_53063bdfa3b2d'),(1225,30,'tabs_3_tab_button_url',''),(1226,30,'_tabs_3_tab_button_url','field_53063bdfa3b2d'),(1227,30,'tabs_4_tab_button_url',''),(1228,30,'_tabs_4_tab_button_url','field_53063bdfa3b2d'),(1229,30,'tabs_5_tab_button_url',''),(1230,30,'_tabs_5_tab_button_url','field_53063bdfa3b2d'),(1232,30,'tabs_0_video_url',''),(1233,30,'_tabs_0_video_u