ire apartment</li>\r\n	<li>Thoroughly clean bathrooms (surfaces, floors, toilet, tub, etc.)</li>\r\n	<li>Dust furniture and ceiling fans</li>\r\n	<li>Clean out refrigerator &amp; pantry</li>\r\n	<li>Deep clean kitchen appliances</li>\r\n	<li>Wipe down countertops &amp; shelves</li>\r\n	<li><a href=\"http://www.woodlandsofgainesville.com/wp-content/uploads/2015/06/MoveOut_reuse_CleaningChecklist.pdf\" target=\"_blank\">Cleaning Checklist</a></li>\r\n</ul>\r\nView the video below to see examples of units that were not property cleaned.\r\n<div class=\"video\">\r\n<h4 class=\"videoTitle\">Cleaning</h4>\r\n<span class=\"videoDescription\">Rooms - Common Areas</span>\r\n<div class=\"clear\"></div>\r\n<iframe src=\"http://player.vimeo.com/video/40887782?portrait=0\" width=\"380\" height=\"214\" frameborder=\"0\"></iframe>\r\n\r\n</div>\r\n<!-- .video -->\r\n\r\n&nbsp;'),(2760,31,'_tabs_1_tab_content','field_5306268e024cc'),(2761,31,'tabs_1_video_url',''),(2762,31,'_tabs_1_video_url','field_53063ccbdc646'),(2763,31,'tabs_2_tab_title','Paint, Walls & Furniture'),(2764,31,'_tabs_2_tab_title','field_53062681024cb'),(2765,31,'tabs_2_tab_button_url',''),(2766,31,'_tabs_2_tab_button_url','field_53063bdfa3b2d'),(2767,31,'tabs_2_tab_content','<h3>Paint, Walls &amp; Damages</h3>\r\nIf you do have damage to your walls and paint it is better not to try to repaint yourself as this will most likely result in more charges to your account due to things like improper painting and unmatched paint. View the video below to see examples of wall and paint damages.\r\n<div class=\"video\">\r\n<h4 class=\"videoTitle\">Walls &amp; Paint</h4>\r\n<span class=\"videoDescription\">Rooms - Common Areas</span>\r\n<div class=\"clear\"></div>\r\n<iframe src=\"http://player.vimeo.com/video/37118025?portrait=0\" width=\"380\" height=\"214\" frameborder=\"0\"></iframe>\r\n\r\n</div>\r\n<!-- .video -->\r\n\r\nView the video below to see examples of hardware &amp; furniture damages to units.\r\n<div class=\"video\">\r\n<h4 class=\"videoTitle\">Damages</h4>\r\n<span class=\"videoDescription\">Rooms - Common Areas</span>\r\n<div class=\"clear\"></div>\r\n<iframe src=\"http://player.vimeo.com/video/40892745?portrait=0\" width=\"380\" height=\"214\" frameborder=\"0\"></iframe>\r\n\r\n</div>\r\n<!-- .video -->\r\n\r\n&nbsp;'),(2768,31,'_tabs_2_tab_content','field_5306268e024cc'),(2769,31,'tabs_2_video_url',''),(2770,31,'_tabs_2_video_url','field_53063ccbdc646'),(2771,31,'tabs_3_tab_title','Turn In Keys'),(2772,31,'_tabs_3_tab_title','field_53062681024cb'),(2773,31,'tabs_3_tab_button_url',''),(2774,31,'_tabs_3_tab_button_url','field_53063bdfa3b2d'),(2775,31,'tabs_3_tab_content','<h3>Turn In Keys &amp; Move Out Form</h3>\r\nMove-out time is July 25th before 12:00 noon. When you are ready to check out, lock your bedroom door behind you and visit the clubhouse to return your keys.\r\n\r\nIf you are moving out after hours, please fill out the<a href=\"http://www.woodlandsofgainesville.com/wp-content/uploads/2015/06/WOG_MoveOut_reuse_ResidentFormAfterHours.pdf\">Move Out Form</a>so that we have documentation of you turning in your keys &amp; wristband, and a forwarding permanent address. Below is a list of replacement charges.\r\n<ul class=\"forms\">\r\n	<li>Door Key $25</li>\r\n	<li>Mail Key $25</li>\r\n	<li>Wristband $4</li>\r\n</ul>'),(2776,31,'_tabs_3_tab_content','field_5306268e024cc'),(2777,31,'tabs_3_video_url',''),(2778,31,'_tabs_3_video_url','field_53063ccbdc646'),(2779,31,'tabs_4_tab_title','Change Of Address'),(2780,31,'_tabs_4_tab_title','field_53062681024cb'),(2781,31,'tabs_4_tab_button_url',''),(2782,31,'_tabs_4_tab_button_url','field_53063bdfa3b2d'),(2783,31,'tabs_4_tab_content','<h3>Change Of Address</h3>\r\nBefore you move out you will need to go to the <a href=\"https://www.usps.com/umove/\" target=\"blank\">USPS Move Out LINK</a> and complete the steps to make sure that all of your mail will get forwarded to your new address. The Woodlands is not responsible for any important mail that you may not get due to not forwarding your mail.'),(2784,31,'_tabs_4_tab_content','field_5306268e024cc'),(2785,31,'tabs_4_video_url',''),(2786,31,'_tabs_4_video_url','field_53063ccbdc646'),(2787,31,'tabs_5_tab_title','Move Out Survey'),(2788,31,'_tabs_5_tab_title','field_53062681024cb'),(2789,31,'tabs_5_tab_button_url',''),(2790,31,'_tabs_5_tab_button_url','field_53063bdfa3b2d'),(2791,31,'tabs_5_tab_content','<h3><a href=\"https://dovetail.wufoo.com/forms/move-out-wog-survey/\" target=\"_blank\"><img class=\"alignnone size-full wp-image-956\" src=\"http://www.woodlandsofgainesville.com/wp-content/uploads/2014/02/MoveOutSurvey_Button.jpg\" alt=\"MoveOutSurvey_Button\" width=\"610\" height=\"100\" /></a></h3>'),(2792,31,'_tabs_5_tab_content','field_5306268e024cc'),(2793,31,'tabs_5_video_url',''),(2794,31,'_tabs_5_video_url','field_53063ccbdc646'),(3193,486,'_wp_attached_file','2014/02/PetBrochure_factsheet_2014_infographic.jpg'),(3194,486,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:600;s:6:\"height\";i:2385;s:4:\"file\";s:50:\"2014/02/PetBrochure_factsheet_2014_infographic.jpg\";s:5:\"sizes\";a:3:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:50:\"PetBrochure_factsheet_2014_infographic-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:6:\"medium\";a:4:{s:4:\"file\";s:49:\"PetBrochure_factsheet_2014_infographic-75x300.jpg\";s:5:\"width\";i:75;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:5:\"large\";a:4:{s:4:\"file\";s:51:\"PetBrochure_factsheet_2014_infographic-257x1024.jpg\";s:5:\"width\";i:257;s:6:\"height\";i:1024;s:9:\"mime-type\";s:10:\"image/jpeg\";}}s:10:\"image_meta\";a:10:{s:8:\"aperture\";i:0;s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";i:0;s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";i:0;s:3:\"iso\";i:0;s:13:\"shutter_speed\";i:0;s:5:\"title\";s:0:\"\";}}'),(3241,496,'_wp_attached_file','2014/05/Woodlands_FuniturePack