will be relet or that a replacement tenant will be found if you fail to take possession, if you are contemplating an early move-out, or if the space is vacated for any other reason.\r\n<h4><strong>You will remain obligated under this Lease and will not be released should you vacate or fail to take possession, save and except as provided for under Paragraph 24 of the Lease.Should the Woodlands of Gainesville secure you a replacement or sublease, we do charge 85% of one months rent as a replacement fee.Should you decide to pursue the sublease process, here are the necessary steps to follow:</strong></h4>\r\n&nbsp;\r\n<h3>Step 1:</h3>\r\nNotify the office that you would like to sublease your apartment. We recommend you both, get listed on our sublease list and pursue trying to find your own Subleaser. If you are able to find your own Subleaser or Replacement, the 85% fee does not apply.\r\n<h3>Step 2:</h3>\r\nOnce you or property management has found someone they need to get approved by management as a credible tenant. They will go through the standard process for an incoming tenant, meaning they will sign a lease and find a qualifying guarantor that must be able to pass a soft credit check.\r\n<h3>Step 3:</h3>\r\nAssuming they pass, the new tenants file must be complete and the tenant must have paid any necessary application fees, deposits, and the first months rent before they can move in.\r\n<h3>Step 4:</h3>\r\nOnce the new tenant is moved in and has begun paying rent, responsibility is then taken from you and passed on to the subleaser.','Sublease','','publish','closed','closed','','sublease','','','2015-06-10 16:09:40','2015-06-10 16:09:40','',9,'http://woodlandswtn.wpengine.com/?page_id=32',5,'page','',0),(34,2,'2014-02-03 15:16:05','2014-02-03 15:16:05','<p><img class=\"alignnone size-full wp-image-486\" alt=\"PetBrochure_factsheet_2014_infographic\" src=\"http://woodlandswtn.wpengine.com/wp-content/uploads/2014/02/PetBrochure_factsheet_2014_infographic.jpg\" wi