closed','closed','','what-to-bring','','','2014-05-27 14:12:18','2014-05-27 14:12:18','',0,'http://woodlandswtn.wpengine.com/?page_id=497',4,'page','',0),(498,3,'2014-05-27 14:19:25','2014-05-27 14:19:25','<p>The All-Inclusive package gives residents the ability to set a more accurate monthly budget and pay rent + utilities all in one check. The resident wont be responsible for dealing with the utility company at all. That means, you wont have to pay the utility company a standard deposit, there are no hassles with sending your check to the utility company, and no time spent trying to collect money from roommates.</p>\r\n<p>***tenant will still be required to pay any utility overages.</p>','Utility Package Option','','publish','closed','closed','','utility-package-option','','','2015-06-09 20:19:03','2015-06-09 20:19:03','',5,'http://woodlandswtn.wpengine.com/?page_id=498',1,'page','',0),(499,3,'2014-05-27 14:20:46','2014-05-27 14:20:46',' ','','','publish','closed','closed','','499','','','2015-07-30 13:16:35','2015-07-30 13:16:35','',5,'http://woodlandswtn.wpengine.com/?p=499',5,'nav_menu_item','',0),(555,2,'2014-08-05 17:31:18','2014-08-05 17:31:18','','HP Slider','','publish','closed','closed','','hp-slider','','','2015-07-08 15:34:45','2015-07-08 15:34:45','',0,'http://woodlandswtn.wpengine.com/?post_type=soliloquy&#038;p=555',0,'soliloquy','',0),(565,3,'2014-10-02 13:01:09','2014-10-02 13:01:09','','social_1000x540','','inherit','closed','closed','','social_1000x540-2','','','2014-10-02 13:01:09','2014-10-02 13:01:09','',555,'http://woodlandswtn.wpengine.com/wp-content/uploads/2014/08/social_1000x540.jpg',0,'attachment','image/jpeg',0),(585,3,'2014-02-03 15:07:26','2014-02-03 15:07:26','','3 BR Town','','publish','closed','closed','','3-br-town','','','2015-07-08 16:33:24','2015-07-08 16:33:24','',7,'http://woodlandswtn.wpengine.com/floorplans/4-br-town-2/',2,'page','',0),(586,3,'2014-02-03 15:07:26','2014-02-03 15:07:26','','2 BR Town','','publish','closed','