,'','publish','closed','closed','','597','','','2015-06-11 19:10:58','2015-06-11 19:10:58','',147,'http://woodlandswtn.wpengine.com/?p=597',1,'nav_menu_item','',0),(601,3,'2014-10-22 18:23:12','2014-10-22 18:23:12','<img class=\"size-medium wp-image-783 aligncenter\" src=\"http://woodlandswtn.wpengine.com/wp-content/uploads/2014/10/IMG_5956_WOSM_thmb-300x200.jpg\" alt=\"Woods of San Marcos\" width=\"300\" height=\"200\" />\r\n\r\nThe first cool breeze to glide through San Marcos brings mix emotions from its residents. It marks the end of summer and long days spent swimming and tubing on the San Marcos river. But, it also means the beginning of another season of fun events and activities that just seem better this time of year. Some of us at The Woods are new in town, so weve had many conversations lately about our favorite things about fall in San Marcos. Here are a few activities were planning this season:\r\n\r\n&nbsp;\r\n\r\n<strong>Wurstfest:</strong> For 10 days out of every year, New Braunfels Landa Park is transformed into all that is Wurstfest. The festival is filled with all things German music, dance, attire, food and beer! The Wurst Wagon also eliminates all the parking issues. This park and ride shuttle picks up from various locations around New Braunfels, even hotels. This year the festival is Nov. 7-16, and were counting the days!\r\n\r\n<strong>Shopping:</strong> Its no secret that San Marcos offers amazing shopping. People travel from all over to visit the outlet malls, and the cool weather makes walking from shop to shop so much more enjoyable. But theres not so well known shopping available in town. Have you attended the Farmers Market? Its on the Square every Tuesday and Saturday. It has some unique food items like sauces and jams, and offers a great way to eat local and organic! Also on the Square, is Art Squared. Art Squared offers local paintings, sculpture, jewelry, music, crafts and more! The last two dates of the year are Nov. 8 and Dec. 13. Its a great place to search for cool finds to put in your new Woods apartment!\r\n\r\n<strong>Outdoors:</strong> We love our #WoodsPets, and were so excited to bring them to the dog park now that the weather is cooler! Were also ready to bring our dogs down to Purgatory Creek. This area offers trails and little places to escape to nature. If you havent been, its the perfect place to check out on a Saturday! Were also ready to hit the river on kayaks. There are so many places in town that offer kayak tours, one of which is located next to our property!\r\n\r\n<strong>Halloween:</strong> Pumpkins, scary movies, costumeswhats not to love about this holiday? Its on Friday this year, which makes it all the more perfect. Next year, well be hosting our Woods Porch Decorating Contest, but this year were excited to decorate the leasing office. Come see what weve conjured up, and check out what well be brining to San Marcos for Fall 2015!\r\n\r\n&nbsp;\r\n\r\nDo you have a favorite fall activity? Tweet us @WoodsofSM and let us know!','Finally, It\'s Fall in San Marcos','','trash','closed','closed','','finally-fall-san-marcos','','','2015-07-24 19:17:26','2015-07-24 19:17:26','',0,'http://woodlandswtn.wpengine.com/?p=601',0,'post','',0),(661,2,'2014-10-21 10:22:03','2014-10-21 10:22:03','','sn-icon_facebook','','inherit','closed','closed','','sn-icon_facebook-3','','','2014-10-21 10:22:03','2014-10-21 10:22:03','',4,'http://woodlandswtn.wpengine.com/wp-content/uploads/2014/01/sn-icon_facebook.svg',0,'attachment','image/svg+xml',0),(662,2,'2014-10-21 10:22:23','2014-10-21 10:22:23','','sn-icon_twitter','','inherit','closed','closed','','sn-icon_twitter-3','','','2014-10-21 10:22:23','2014-10-21 10:22:23','',4,'http://woodlandswtn.wpengine.com/wp-content/uploads/2014/01/sn-icon_twitter.svg',0,'attachment','image/svg+xml',0),(663,2,'2014-10-21 10:22:38','2014-10-21 10:22:38','','sn-icon_instagram','','inherit','closed','closed','','sn-icon_instagram-3','','','2014-10-21 10:22:38